import React from 'react'

import {useNavigate } from 'react-router-dom';

function TravelList({travel,deleteTravel}) {
    const navigate = useNavigate();
  return (
    <div className="page-content">

      {travel.map((el)=>{
      return <div className="card">
       <div className="content">
         <h2 className="title">{el.title}</h2>
         <p className="copy">
           {el.story}
         </p>
         <img src={el.imageUrl} alt="ss" />
         <h2 className="title">{el.visitedDate}</h2>

         <button className="btn" onClick={()=>navigate("/detailes")}>View Trips</button>
       </div>
       <button className="btn" onClick={()=>navigate("/update")}>update</button>
       <button className="btn" onClick={()=>deleteTravel}>delete</button>

     </div>


      })}
      
    </div>
  )
}

export default TravelList
